import React, { Component } from 'react';
import { Map, GoogleApiWrapper, Marker, InfoWindow } from 'google-maps-react';
import sf_housing_data from '../assets/mocks/sf_housing_data.json'

const mapStyles = {
  width: '50%',
  height: '85%'
};

const markerIcon = 'https://developers.google.com/maps/documentation/javascript/examples/full/images/beachflag.png';

export class MapContainer extends Component {
  render() {



    return (


      <Map
        google={this.props.google}
        zoom={12.5}
        style={mapStyles}
        initialCenter={{
         lat: 37.733467,
         lng: -122.4363648
        }}
      >


        <Marker position={
          {
            lat: 37.770629,
            lng: -122.428188
          } }
          // icon={{
          //   url: markerIcon
          // }}
        />

        </Map>



    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyCnSDhOvVgqhllnk8dwv0UIiIEbfd5slpU'
})(MapContainer);
